import React, { useState } from 'react';
import './App.css'; // Importa el archivo CSS
import { useNavigate } from 'react-router-dom';
import { Bar } from "react-chartjs-2";
import casaAtras from "./Imagenes/CasaNegra.png";
import cruzAtras from "./Imagenes/CruzBlanca.png";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarController,
  BarElement,
  Title,
  Tooltip,
  Legend
} from "chart.js";

ChartJS.register(
  Title,
  Tooltip,
  Legend,
  CategoryScale,
  LinearScale,
  BarElement,
  BarController
);

function Resultado() {
  const data = {
    labels: ['Label 1', 'Label 2', 'Label 3', 'Label 4', 'Label 5'],
    datasets: [
      {
        label: 'Data Series 1',
        backgroundColor: 'rgba(75, 192, 192, 0.6)',
        borderColor: 'rgba(75, 192, 192, 1)',
        borderWidth: 1,
        data: [12, 19, 3, 5, 2],
      },
    ],
  };

  const options = {
    scales: {
      y: {
        beginAtZero: true,
      },
    },
  };

  const navigate = useNavigate();
  const [selectedMedicine, setSelectedMedicine] = useState('a');

  const medicamento = {
    idMedicamento: 1,
    nombreMedicamento: "Nombre del Medicamento",
    nombreMedicamentoIngles: "Nombre en Inglés del Medicamento",
    claseMedicamento: "Clase del Medicamento",
    añoPrimeraMencion: "Año de Primera Mención",
    instituto: "Instituto",
    estadoActual: "Estado Actual",
    faseDesarrolloMasAlta: "Fase de Desarrollo Más Alta",
    suspension: "Suspensión",
    mecanismoAcc_patogenoObj: "Mecanismo Acc. Patógeno Obj",
    info: "Información",
    patente: "Patente"
  };

  const handleMedicineClick = (label) => {
    setSelectedMedicine(label);
  };

  const goBack = () => {
    navigate(process.env.PUBLIC_URL + '/');
  };
  const cerrar = () => {
    setSelectedMedicine(null)
  };

  return (
    <>
      <link rel='stylesheet' href='https://cdn.jsdelivr.net/npm/bootstrap@4.3.1/dist/css/bootstrap.min.css' />
      <script src='https://cdn.jsdelivr.net/npm/bootstrap@4.3.1/dist/js/bootstrap.bundle.min.js'></script>

      <section className="credit-card bg-news2 d-flex flex-column align-items-center" style={{opacity: selectedMedicine ? 0.4 : 1 }}>
        <div className="d-flex justify-content-end align-items-center w-100 mr-5">
          <img src={casaAtras} alt="Volver" onClick={goBack} style={{ cursor: 'pointer' }} />
        </div>
        <div className="container">
          <h2 className="text-center mb-5" style={{ fontFamily: 'Abhaya Libre', fontWeight: 'bold', letterSpacing: '1px' }}>PREDICTOR DE MEDICAMENTO EFECTIVO</h2>

          <div className="card-holder">
            <div className="card-box" style={{ backgroundColor: 'white' }}>
              <div className="row">
                <div className="col-lg-12" style={{ width: '150vh', height: '60vh' }}>
                  <Bar
                    data={data}
                    options={options}
                    onElementsClick={(elems) => {
                      if (elems.length > 0) {
                        const index = elems[0].index;
                        const label = data.labels[index];
                        handleMedicineClick(label);
                      }
                    }}
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      <div className="d-flex flex-column justify-content-center align-items-center" style={{ position: 'absolute', top: '200px', left: '550px', zIndex: 5 }}>
        {selectedMedicine && (
        <div className="card-box p-3 d-flex flex-column align-items-center" style={{ width: '800px', height: '600px', backgroundColor: '#313131', position: 'relative' }}>
          <img src={cruzAtras} alt="Cerrar" onClick={cerrar} style={{ cursor: 'pointer', position: 'absolute', top: '10px', right: '10px' }} />
          <h4 className="text-white">Detalles de "{selectedMedicine}"</h4>
          
          <div className="text-white pt-5 pl-3 d-flex justify-content-between" style={{ fontWeight: 'normal' }}>
            <div style={{ marginRight: '30px' }}>
              <p>Nombre: {medicamento.nombreMedicamento}</p>
              <p>Estado actual: {medicamento.estadoActual}</p>
              <p>Clase de medicamento: {medicamento.claseMedicamento}</p>
              <p>Año de primera mención: {medicamento.añoPrimeraMencion}</p>
              <p>Instituto: {medicamento.instituto}</p>
            </div>
            <hr style={{ width: '1px', height: 'auto', border: '1px solid white', margin: '0 20px' }} />
            <div style={{ marginLeft: '20px' }}>
              <p>Nombre en inglés: {medicamento.nombreMedicamentoIngles}</p>
              <p>Fase de desarrollo más alta: {medicamento.faseDesarrolloMasAlta}</p>
              <p>Suspensión: {medicamento.suspension}</p>
              <p>Mecanismo Acc. Patógeno Obj: {medicamento.mecanismoAcc_patogenoObj}</p>
              <p>Información: {medicamento.info}</p>
              <p>Patente: {medicamento.patente}</p>
            </div>
          </div>

        </div>
        )}
      </div>


    </>
  );
}

export default Resultado;
